(298, 1, '2023-08-23 05:16:15', '2023-08-23 05:16:15', 'बक्सर, पटना, दानापुर, खगड़िया व पाटलिपुत्र के रास्ते वडोदरा- गुवाहाटी स्पेशल ट्रेन के परिचालन का निर्णय लिया गया है. इसके साथ ही कई ट्रेनों का विभिन्न स्टेशनों पर ठहराव दिया गया है. रेलवे ने यात्रियों की सुविधा को देखते हुए यह निर्णय लिया है.\r\n\r\nडीडीयू- पाटलिपुत्र के रास्ते वडोदरा जंक्शन से गुवाहाटी के बीच स्पेशल ट्रेन के परिचालन का रेलवे ने निर्णय लिया है. ऐसा यात्रियों की सुविधा को ध्यान में रखकर किया है. इसके साथ ही कई ट्रेनों का विभिन्न स्टेशनों पर ठहराव देने का निर्णय भी लिया गया है. पूर्व मध्य रेलवे के मुख्य जनसंपर्क अधिकारी वीरेंद्र कुमार ने इस मामले में जानकारी दी है. उन्होंने बताया है कि यात्रियों की सुविधा के मद्देनजर वडोदरा जं. और गुवाहाटी के मध्य गाड़ी संख्या 09103 वडोदरा-गुवाहाटी वन-वे स्पेशल ट्रेन का परिचालन किया जाएगा. यह स्पेशल ट्रेन वडोदरा से दिनांक 24.08.2023 (गुरूवार) को 16.20 बजे प्रस्थान कर पंडित दीन दयाल उपाध्याय जंक्शन, बक्सर, आरा, दानापुर, पाटलिपुत्र, हाजीपुर, बरौनी, खगड़िया आदि स्टेशनों पर रूकते हुए दिनांक 26.08.2023 (शनिवार) को 19.00 बजे गुवाहाटी पहुंचेगी.\r\n<h3>4 जोड़ी ट्रेनों का धनबाद मंडल के विभिन्न स्टेशनों पर ठहराव</h3>\r\nयात्रियों की सुविधा के मद्देनजर दिनांक 25.08.2023 से गाड़ी संख्या 18625/ 26 पूर्णिया कोर्ट-हटिया- पूर्णिया कोर्ट एक्सप्रेस का चौबे स्टेशन पर, 18623/24 इस्लामपुर- हटिया-इस्लामपुर एक्सप्रेस का गझंडी स्टेशन पर, 12987/ 88 सियालदह-अजमेर- सियालदह एक्सप्रेस का हजारीबाग रोड स्टेशन पर तथा गाड़ी संख्या 12379/80 अमृतसर-सियालदह-अमृतसर एक्सप्रेस का कोडरमा स्टेशन पर निम्नानुसार ठहराव प्रदान करने का निर्णय लिया गया है:\r\n<h3>इन ट्रेनों का अलग- अलग स्टेशनों पर ठहराव..</h3>\r\n<ul>\r\n 	<li>1. गाड़ी संख्या 18625 पूर्णिया कोर्ट-हटिया एक्सप्रेस 16.04 बजे चौबे स्टेशन पहुंचेगी तथा 16.06 बजे प्रस्थान करेगी.</li>\r\n 	<li>1. गाड़ी संख्या 18625 पूर्णिया कोर्ट-हटिया एक्सप्रेस 16.04 बजे चौबे स्टेशन पहुंचेगी तथा 16.06 बजे प्रस्थान करेगी.</li>\r\n 	<li>1. गाड़ी संख्या 18625 पूर्णिया कोर्ट-हटिया एक्सप्रेस 16.04 बजे चौबे स्टेशन पहुंचेगी तथा 16.06 बजे प्रस्थान करेगी.</li>\r\n 	<li>1. गाड़ी संख्या 18625 पूर्णिया कोर्ट-हटिया एक्सप्रेस 16.04 बजे चौबे स्टेशन पहुंचेगी तथा 16.06 बजे प्रस्थान करेगी.</li>\r\n 	<li>1. गाड़ी संख्या 18625 पूर्णिया कोर्ट-हटिया एक्सप्रेस 16.04 बजे चौबे स्टेशन पहुंचेगी तथा 16.06 बजे प्रस्थान करेगी.</li>\r\n 	<li>1. गाड़ी संख्या 18625 पूर्णिया कोर्ट-हटिया एक्सप्रेस 16.04 बजे चौबे स्टेशन पहुंचेगी तथा 16.06 बजे प्रस्थान करेगी.</li>\r\n</ul>\r\n<h3>बछवारा स्टेशन पर रूकेगी जनहित एक्सप्रेस..</h3>\r\nयात्रियों की सुविधा हेतु सहरसा और पाटलिपुत्र के मध्य चलने वाली गाड़ी संख्या 13205/06 सहरसा-पाटलिपुत्र-सहरसा जनहित एक्सप्रेस का बछवारा स्टेशन पर ठहराव प्रदान करने का निर्णय लिया गया है. गाड़ी संख्या 13205 सहरसा-पाटलिपुत्र जनहित एक्सप्रेस दिनांक 04.09.2023 से 02.08 बजे बछवारा स्टेशन पहुंचेगी तथा 02.10 बजे यहां से प्रस्थान करेगी. वहीं, वापसी में गाड़ी संख्या 13206़ पाटलिपुत्र-सहरसा जनहित एक्सप्रेस दिनांक 03.09.2023 से 11.11 बजे बछवारा स्टेशन पहुंचेगी तथा 11.13 बजे प्रस्थान करेगी. इसी क्रम में दिनांक 09.09.2023 से गाड़ी संख्या 14617 बनमंखी-अमृतसर जनसेवा एक्सप्रेस का प्रायोगिक तौर पर एकमा में ठहराव प्रदान किया गया है. दिनांक 09.09.2023 से यह गाड़ी 16़.25 बजे एकमा पहुंचेगी तथा यहां से 16.27 बजे प्रस्थान करेगी. बता दें कि रेलवे अक्सर यात्रियों की सुविधा के लिए कार्य करती है. इसी कड़ी में अलग- अलग स्टेशनों पर विभिन्न ट्रेनों का ठहराव दिया गया है. साथ ही स्पेशल ट्रेन के परिचालन का भी निर्णय लिया गया है.', 'बिहार: पटना के रास्ते वडोदरा- गुवाहाटी स्पेशल का परिचालन, कई ट्रेनों का विभिन्न स्टेशनों पर ठहराव, देखें लिस्ट', '', 'publish', 'open', 'open', '', '%e0%a4%ac%e0%a4%bf%e0%a4%b9%e0%a4%be%e0%a4%b0-%e0%a4%aa%e0%a4%9f%e0%a4%a8%e0%a4%be-%e0%a4%95%e0%a5%87-%e0%a4%b0%e0%a4%be%e0%a4%b8%e0%a5%8d%e0%a4%a4%e0%a5%87-%e0%a4%b5%e0%a4%a1%e0%a5%8b%e0%a4%a6', '', '', '2023-08-23 05:16:15', '2023-08-23 05:16:15', '', 0, 'https://starnewsmedia.in/?p=298', 0, 'post', '', 0),
