(301, 1, '2023-08-23 05:26:32', '2023-08-23 05:26:32', '<p class=\"stry-shrt-head\">Chandrayaan 3 Landing live updates: मिशन चंद्रयान-3 बुधवार को चांद पर कदम रखने को तैयार है। इसरो का अंतरिक्ष यान सफलतापूर्वक अपने अंतिम चरण में पहुंच गया है और विक्रम लैंडर 23 अगस्त की शाम छह बजकर चार</p>\r\n<strong>Chandrayaan 3 Landing live updates:</strong> मिशन चंद्रयान-3 बुधवार को चांद पर कदम रखने को तैयार है। इसरो का अंतरिक्ष यान सफलतापूर्वक अपने अंतिम चरण में पहुंच गया है और विक्रम लैंडर 23 अगस्त की शाम छह बजकर चार मिनट पर चंद्रमा के दक्षिणी ध्रुव पर सॉफ्ट लैंडिंग करेगा। इसरो के वैज्ञानिकों का दावा है कि विषम परिस्थितियों में भी लैंडिंग सफल रहेगी। अब तक मिशन पूरी तरह से अच्छा प्रदर्शन कर रहा है और सभी की निगाहें सॉफ्ट लैंडिंग पर हैं। अगर यह सफल होता है तो भारत यह कारनामा करने वाला चौथा देश हो जाएगा। अभी तक अमेरिका, सोवियत संघ और रूस ने चांद पर सफल लैंडिंग की है। वहीं चांद के दक्षिणी ध्रुव पर उतरने वाला दुनिया का इकलौता देश बन जाएगा।\r\n<h3 class=\"lv-blghdng\">Chandryaan 3 landing live : आसान नहीं है सॉफ्ट लैंडिंग</h3>\r\n<span style=\"color: #333399;\"><strong>Wed, 23 Aug 2023 10:25 AM</strong></span>\r\n\r\nचंद्रयान लैंडिंग लाइव अपडेट:  रूस जैसा देश जो कि 1976 में भी चांद पर पहुंच चुका है अगर अब चंद्रमा पर सॉफ्ट लैंडिंग कराने में विफल हो जाता है तो इससे पता लगया जा सकता है कि यह कितना मुश्किल है। हालांकि इसरो ने मिशन को सफल करने के लिए पूरी तैयारी की है और वैज्ञानिक उत्साह और विश्वास से भरपूर हैं। चंद्रयान की सफलता के लिए पूरे देश में प्रार्थनाएं की जा रही हैं। वैष्णो देवी की गुफा योग मंदिर टपकेश्वर महादेव देहरादून की तरफ से हरिद्वार में हवन पूजा कराई गई। इके अलावा अजमेर शरीफ दरगाह पर भी चंद्रयान की सफलता के लिए दुआ मांगी गई।\r\n<div class=\"feed-head\"><strong><span style=\"color: #333399;\">Wed, 23 Aug 2023 10:14 AM</span></strong></div>\r\n<div class=\"lvblg-bdy\">\r\n<h3 class=\"lv-blghdng\">Chandryaan 3 landing live: चंद्रयान की सफलता के बाद होगा विशाल यज्ञ</h3>\r\nविश्व हिंदू परिषद (विहिप) ने मंगलवार को कहा कि चंद्रमा की सतह पर चंद्रयान-3 के सफलतापूर्वक उतरने की कामना करते हुए राष्ट्रीय राजधानी में एक विशाल यज्ञ किया जाएगा।      उसने कहा कि संत नगर के आर्य समाज मंदिर में आर्य समाज और विहिप द्वारा बुधवार सुबह यह यज्ञ किया जाएगा। भारतीय अंतरिक्ष अनुसंधान संगठन (इसरो) का महत्वाकांक्षी तीसरा चंद्र मिशन \'चंद्रयान-3\' बुधवार शाम को चंद्रमा की सतह पर उतरने वाला है।\r\n<div class=\"feed-head\"><span style=\"color: #333399;\"><strong>Wed, 23 Aug 2023 05:52 AM</strong></span></div>\r\n<div class=\"lvblg-bdy\">\r\n<h3 class=\"lv-blghdng\">Chandrayaan 3 Landing live updates: इस बार विक्रम लैंडर का पैर मजबूत, मिशन के सफल होने की उम्मीद</h3>\r\n<strong>Chandrayaan 3 Landing live updates:</strong> भारतीय खगोल भौतिकी संस्थान (आईआईए) के पूर्व प्रोफेसर आरसी कपूर ने मंगलवार को कहा कि भारत के तीसरे चंद्र मिशन के लैंडर और रोवर चंद्रयान-2 की विफलता से सीख बनाए हुए हैं। चंद्रयान-3 हर तरह से सुसज्जित है और इसकी लैंडिंग निर्धारित तरीके से सफल होगी। उन्होंने कहा कि इसरो ने 2019 में लॉन्च किए गए चंद्रयान -2 मिशन की विफलता से सीखा है। कपूर ने मुताबिक, इसरो वैज्ञानिकों ने चंद्रयान-3 में कई सारे बदलाव किए हैं। इस बार एल्गोरिदम को मुक्त कर दिया गया है और लैंडर के पैर को मजबूत किया गया है, ताकि सतह पर गिरते समय उसका संतुलन बना रहे। कपूर ने कहा कि यह डिजाइन लैंडिंग के समय तीन मीटर प्रति सेकंड की गति भी झेल सकता है। वहीं इसका वजन भी चंद्रयान-2 के पिछले लैंडर रोव से 250 ग्राम अधिक है। उन्होंने बताया कि इस बार अतिरिक्त ईंधन भी है, यानी लैंडर को चंद्रमा की सतह तक पहुंचने के लिए कोई दिक्कत नहीं होगी।\r\n\r\n</div>\r\n<div class=\"cont\"><img class=\"alignnone size-medium wp-image-302\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/chandryan3-300x169.jpg\" alt=\"\" width=\"300\" height=\"169\" /></div>\r\n<div class=\"feed-head\"><small></small><span style=\"color: #333399;\"><strong>Wed, 23 Aug 2023 05:52 AM</strong></span></div>\r\n<div class=\"lvblg-bdy\">\r\n<h3 class=\"lv-blghdng\">Chandrayaan 3 Landing live: तय कार्यक्रम के अनुसार आगे बढ़ रहा चंद्रयान-3 मिशन : ISRO</h3>\r\nChandrayaan 3 Landing live: भारतीय अंतरिक्ष अनुसंधान संगठन (इसरो) ने मंगलवार को कहा कि चंद्रयान-3 मिशन निर्धारित कार्यक्रम के अनुसार आगे बढ़ रहा है। लैंडर (विक्रम) और रोवर (प्रज्ञान) से युक्त लैंडर मॉड्यूल के बुधवार शाम छह बजकर चार मिनट पर चंद्रमा की सतह के दक्षिण ध्रुव पर उतरने की उम्मीद है। अंतरिक्ष एजेंसी ने बताया कि इसरो टेलीमेट्री, ट्रैकिंग और कमांड नेटवर्क\' (आईएसटीआरएसी) में स्थित मिशन ऑपरेशंस कॉम्प्लेक्स में उत्साह का माहौल है। इसरो ने चंद्रमा पर भारत के तीसरे मिशन की जानकारी देते हुए कहा, मिशन अपने तय कार्यक्रम के अनुसार आगे बढ़ रहा है। प्रणालियों की नियमित जांच की जा रही है। लैंडर का सुचारू संचालन जारी है। उनके मुताबिक, एमओएक्स, आईएसटीआरएसी से चंद्रयान-3 के चंद्रमा की सतह पर उतरने का सीधा प्रसारण बुधवार शाम पांच बजकर 20 मिनट से शुरू किया जाएगा।\r\n\r\n</div>\r\n</div>\r\n&nbsp;', 'Chandrayaan 3 Landing LIVE: आज चांद पर होगा भारत का सूर्योदय, VC के जरिए जुड़ेंगे PM मोदी', '', 'publish', 'open', 'open', '', 'chandrayaan-3-landing-live-%e0%a4%86%e0%a4%9c-%e0%a4%9a%e0%a4%be%e0%a4%82%e0%a4%a6-%e0%a4%aa%e0%a4%b0-%e0%a4%b9%e0%a5%8b%e0%a4%97%e0%a4%be-%e0%a4%ad%e0%a4%be%e0%a4%b0%e0%a4%a4-%e0%a4%95%e0%a4%be', '', '', '2023-08-23 05:27:25', '2023-08-23 05:27:25', '', 0, 'https://starnewsmedia.in/?p=301', 0, 'post', '', 0),
