(335, 1, '2023-08-26 09:01:55', '2023-08-26 09:01:55', 'भाई और बहन के अटूट प्रेम का त्यौहार <strong>रक्षाबंधन</strong> की तैयारी शुरू हो गई है। इसी बीच भोजपुरी की सुपरस्टार एक्टर और सिंगर अक्षरा सिंह का रक्षाबंधन स्पेशल गाना \"कलाई पे प्यार\" रिलीज कर किया गया है, जो उनके फैंस और भोजपुरी के चाहने वालों को बेहद पसंद आ रही है। इस गाने में अक्षरा सिंह अपने भाई की कलाई पर राखी बांधती नजर आ रही हैं। अक्षरा सिंह का या खूबसूरत गाना उनके अपने ऑफिशल यूट्यूब चैनल से रिलीज हुआ है। इस गाने के लिरिक्स बेहद खूबसूरत है, जिसे अक्षरा ने अपनी आवाज देकर और कर्ण प्रिय बना दिया है।\n\nलिंक : <a href=\"https://starnewsmedia.in/2023/08/26/akshra-singh-%e0%a4%95%e0%a4%be-%e0%a4%b0%e0%a4%95%e0%a5%8d%e0%a4%b7%e0%a4%be%e0%a4%ac%e0%a4%82%e0%a4%a7%e0%a4%a8-%e0%a4%b8%e0%a5%8d%e0%a4%aa%e0%a5%87%e0%a4%b6%e0%a4%b2-%e0%a4%97%e0%a4%be%e0%a4%a8/\" target=\"_blank\" rel=\"noopener\">https://www.youtube.com/watch?v=6MTgi0f_GAw</a>\n\n<img class=\"alignnone size-medium wp-image-328\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-26-at-13.42.06-300x144.jpeg\" alt=\"\" width=\"300\" height=\"144\" />\n\n<strong>अक्षरा सिंह</strong> ने अपने इस गाने को लेकर कहा कि बचपन से ही रक्षाबंधन के त्यौहार को लेकर एक्साइटेड रहती हूं। अगर देखा जाए तो भाई और बहन का रिश्ता सही मायने में सबसे पवित्र रिश्ता होता है। और भाई बहन के इस रिश्ते को समर्पित रक्षाबंधन का त्यौहार एक अद्भुत अनुभूति प्रदान करता है। उन्होंने कहा कि मेरा यह गाना भी भाई-बहन के प्रेम को समर्पित है। इस दिन बहन अपने भाई की कलाई पर रेशम के धागे बांधकर रक्षा का वचन लेती है। इसमें एक निश्छल प्रेम भी छुपा होता है। यह प्रेम मेरे इस गाने में भी भर भर के देखने को मिलेगा, जब एक भाई अपनी खेती किसानी से बहन को अवसर बना देता है। और उसके बाद जब बहन घर रक्षाबंधन के दिन अपने भाई से मिलने आती है तो यह पल काफी हार्ट टचिंग होता है। उन्होंने कहा कि इस गाने को आप जरूर देखें और सुनें। रक्षाबंधन को लेकर यह मेरा इस साल सबसे पहला गाना है। उम्मीद करती हूं सभी श्रोता बंधुओं को यह गाना पसंद आएगी।\n\n<img class=\"alignnone size-medium wp-image-329\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-26-at-13.42.06-1-300x136.jpeg\" alt=\"\" width=\"300\" height=\"136\" />\n\nआपको बताते कि सबों के दिलों पर राज करने वाली<strong> अक्षरा सिंह</strong> ने सावन में बाबा भोलेनाथ के एक से बढ़कर एक गाने गई, जिस पर लोगों ने दिल खोलकर अपना प्यार और आशीर्वाद लुटाया। लेकिन अब अक्षरा सिंह का रक्षाबंधन स्पेशल गाना भी रिलीज हो गया है, जो लोगों को पसंद आ रही है। \"कलाई पे प्यार\" गाने का लिरिक्स मनोज मतलबी ने तैयार किया है जबकि इसके म्यूजिक डायरेक्टर शिशिर पांडेय हैं। गाने के पीआरओ रंजन सिन्हा हैं और डीओपी नवीन शर्मा हैं।', 'Akshra Singh का रक्षाबंधन स्पेशल गाना \"कलाई पे प्यार\" हुआ रिलीज', '', 'inherit', 'closed', 'closed', '', '326-autosave-v1', '', '', '2023-08-26 09:01:55', '2023-08-26 09:01:55', '', 326, 'https://starnewsmedia.in/?p=335', 0, 'revision', '', 0),
