m wp-image-329\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-26-at-13.42.06-1-300x136.jpeg\" alt=\"\" width=\"300\" height=\"136\" />\r\n\r\nआपको बताते कि सबों के दिलों पर राज करने वाली<strong> अक्षरा सिंह</strong> ने सावन में बाबा भोलेनाथ के एक से बढ़कर एक गाने गई, जिस पर लोगों ने दिल खोलकर अपना प्यार और आशीर्वाद लुटाया। लेकिन अब अक्षरा सिंह का रक्षाबंधन स्पेशल गाना भी रिलीज हो गया है, जो लोगों को पसंद आ रही है। \"कलाई पे प्यार\" गाने का लिरिक्स मनोज मतलबी ने तैयार किया है जबकि इसके म्यूजिक डायरेक्टर शिशिर पांडेय हैं। गाने के पीआरओ रंजन सिन्हा हैं और डीओपी नवीन शर्मा हैं।', 'Akshra Singh का रक्षाबंधन स्पेशल गाना \"कलाई पे प्यार\" हुआ रिलीज', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2023-08-26 09:03:54', '2023-08-26 09:03:54', '', 326, 'https://starnewsmedia.in/?p=337', 0, 'revision', '', 0),
