घर रक्षाबंधन के दिन अपने भाई से मिलने आती है तो यह पल काफी हार्ट टचिंग होता है। उन्होंने कहा कि इस गाने को आप जरूर देखें और सुनें। रक्षाबंधन को लेकर यह मेरा इस साल सबसे पहला गाना है। उम्मीद करती हूं सभी श्रोता बंधुओं को यह गाना पसंद आएगी।\r\n\r\n<img class=\"alignnone wp-image-329 size-large\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-26-at-13.42.06-1-1024x464.jpeg\" alt=\"\" width=\"640\" height=\"290\" />\r\n\r\nआपको बताते कि सबों के दिलों पर राज करने वाली<strong> अक्षरा सिंह</strong> ने सावन में बाबा भोलेनाथ के एक से बढ़कर एक गाने गई, जिस पर लोगों ने दिल खोलकर अपना प्यार और आशीर्वाद लुटाया। लेकिन अब अक्षरा सिंह का रक्षाबंधन स्पेशल गाना भी रिलीज हो गया है, जो लोगों को पसंद आ रही है। \"कलाई पे प्यार\" गाने का लिरिक्स मनोज मतलबी ने तैयार किया है जबकि इसके म्यूजिक डायरेक्टर शिशिर पांडेय हैं। गाने के पीआरओ रंजन सिन्हा हैं और डीओपी नवीन शर्मा हैं।', 'Akshra Singh का रक्षाबंधन स्पेशल गाना \"कलाई पे प्यार\" हुआ रिलीज', '', 'inherit', 'closed', 'closed', '', '326-revision-v1', '', '', '2023-08-26 09:06:32', '2023-08-26 09:06:32', '', 326, 'https://starnewsmedia.in/?p=339', 0, 'revision', '', 0),
(342, 1, '2023-08-29 06:09:44', '2023-08-29 06:09:44', 'भोजपुरी सिनेमा के फिटनेस अइकन <strong>विक्रांत सिंह</strong> राजपूत निर्माता <strong>प्रदीप सिंह</strong> और निर्देशक  की फिल्म “भूत” में धमाल मचाने वाले हैं। इस फिल्म की शूटिंग इन दिनों उत्तराखंड के पहाड़ों और जंगलों में की जा रही है। बताया जा रहा है कि यह हॉरर जोनर की फिल्म है, जिसमें विक्रांत सिंह राजपूत के साथ खुद अवधेश मिश्रा भी स्क्रीन शेयर करते नजर आएंगे। फिल्म भूत एक नायाब कहानी पर बेस्ड है। फिल्म में विक्रांत सिंह राजपूत एक अहम किरदार में नजर आने वाले हैं। इसमें उनका डिफरेंट लुक दर्शकों को देखने को मिलेगा, जिसको लेकर वे काफी खुश हैं। निर्माता प्रदीप सिंह और निर्देशक अवधेश मिश्रा हैं। विक्रांत सिंह राजपूत फिलहाल उत्तराखंड की पहाड़ियों में फिल्म “भूत” की शूटिंग में बिजी हैं और बेहद उत्साहित भी नजर आ रहे हैं। इस फिल्म में उनके साथ भोजपुरी की वारस्टाइल एक्ट्रेस <strong>ऋतु सिंह</strong> भी नजर आ रही हैं, जो उनकी बहन का किरदार कर रही हैं।जबकि उनके अपोजिट होंगी श्रुति राव।\r\n\r\n<img class=\"alignnone size-medium wp-image-344\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-29-at-11.32.05-225x300.jpeg\" alt=\"\" width=\"225\" height=\"300\" />\r\n\r\nवहीं विक्रांत सिंह राजपूत ने कहा कि फिल्म “भूत” की पटकथा ने मुझे इस फिल्म की ओर खूब आकर्षित किया है। मुझे खुशी है कि अब मैं इस फिल्म का हिस्सा हूं और सबसे भारी बात यह है कि भोजपुरी के दिग्गज कलाकार अवधेश मिश्रा के निर्देशन में अभिनय का मौका मिल रहा है। बतौर निर्देशक, उनके साथ यह मेरी पहली फिल्म है तो थोड़ा नर्वसनेस भी लाजमी है लेकिन एक कलाकार के रूप में फिर भी मैं अपना हंड्रेड परसेंट दूंगा। फिल्म “भूत” के कहानी के अनुसार इसके गीत और संगीत भी होने वाले हैं। फिल्म को लेकर हम सभी उत्साहित हैं और हमारी फिल्म बड़े बजट की होने वाली है जो दर्शकों का खूब मनोरंजन भी करेगी।\r\n\r\nआपको बता दें कि वर्ल्ड वाइड प्रोडक्शन की प्रदीप सिंह कृत फिल्म \"भूत\" में विक्रांत सिंह राजपूत, अवधेश मिश्रा, <strong>ऋतु सिंह</strong>,श्रुति राव, केके गोस्वामी, अनीता रावत, बालेश्वर, श्रुति, राधा सिंह,महेश आचार्य,हीरा यादव,रोहित सिंह मटरू आदि मुख्य भूमिका में हैं। फिल्म के निर्माता<strong> प्रदीप सिंह</strong> और प्रतीक सिंह हैं। निर्देशक अवधेश मिश्रा हैं।फिल्म के गीतकार और संगीतकार अमन श्लोक हैं। पीआरओ रंजन सिन्हा हैं। डीओपी <strong>जगमिंदर सिंह</strong> जग्गी हैं। फ़िल्म का निर्माण वर्ल्ड वाइड प्रोडक्शन के बैनर तले किया जा रहा है।', 'Pradeep Singh और Awdhesh Mishra की फिल्म “भूत” में फिट अइकन विक्रांत सिंह राजपूत मचाएंगे धमाल', '', 'publish', 'open', 'open', '', 'pradeep-singh-%e0%a4%94%e0%a4%b0-awdhesh-mishra-%e0%a4%95%e0%a5%80-%e0%a4%ab%e0%a4%bf%e0%a4%b2%e0%a5%8d%e0%a4%ae-%e0%a4%ad%e0%a5%82%e0%a4%a4-%e0%a4%ae%e0%a5%87%e0%a4%82-%e0%a4%ab', '', '', '2023-08-29 06:12:50', '2023-08-29 06:12:50', '', 0, 'https://starnewsmedia.in/?p=342', 0, 'post', '', 0),
