हैं। फिल्म के निर्माता<strong> प्रदीप सिंह</strong> और प्रतीक सिंह हैं। निर्देशक अवधेश मिश्रा हैं।फिल्म के गीतकार और संगीतकार अमन श्लोक हैं। पीआरओ रंजन सिन्हा हैं। डीओपी <strong>जगमिंदर सिंह</strong> जग्गी हैं। फ़िल्म का निर्माण वर्ल्ड वाइड प्रोडक्शन के बैनर तले किया जा रहा है।', 'Pradeep Singh और Awdhesh Mishra की फिल्म “भूत” में फिट अइकन विक्रांत सिंह राजपूत मचाएंगे धमाल', '', 'inherit', 'closed', 'closed', '', '342-revision-v1', '', '', '2023-08-29 06:09:44', '2023-08-29 06:09:44', '', 342, 'https://starnewsmedia.in/?p=345', 0, 'revision', '', 0),
(346, 1, '2023-08-31 04:50:50', '2023-08-31 04:50:50', 'बाबा मोशन पिक्चर्स के बैनर से बनने वाली बॉलीवुड अभिनेता राहुल शर्मा और <strong>मेघाश्री</strong> स्टारर फिल्म \"मांग भरो सजना\" की शूटिंग भव्य मुहूर्त के साथ शुरू हो गई है। फिल्म के शूटिंग लखनऊ की खूबसूरत वादियों में हो रही है, जिसमें राहुल शर्मा फिल्म डार्लिंग के बाद एक बार फिर से दमदार भूमिका में नजर आने वाले हैं। इसका अंदाजा फिल्म के पहले दिन के शूट से लगाया जाने लगा है। फिल्म \"मांग भरो सजना\" की पटकथा सामाजिक और पारिवारिक धागों से पिरोई गई है, जो खुद राहुल शर्मा ने बताया। उन्होंने कहा कि फिल्म मेरे लिए बेहद महत्वपूर्ण है और पिछली फिल्म में मिले दर्शकों के प्यार और आशीर्वाद ने मुझे एक बार फिर से भोजपुरी में फिल्म करने को प्रेरित किया है। इस फिल्म में भी मेरी भूमिका बेहद अलग है, जो आपका खूब मनोरंजन करेगी। फिल्म के गीत संगीत भी एक से बढ़कर एक होने वाले हैं। फिल्म मनोरंजन का बेजोड़ पैकेज बन कर उभरेगा। अच्छी कहानी व कथा वाली फिल्म को करना मेरी प्रायरिटी रही है।\r\n\r\n<img class=\"alignnone size-medium wp-image-348\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-31-at-10.16.10-300x200.jpeg\" alt=\"\" width=\"300\" height=\"200\" />\r\n\r\nफिल्म \"मांग भरो सजना\" राकेश त्रिपाठी ने बताया कि फिल्म जितना लोग सोच रहे हैं, उससे ज्यादा अच्छी बने इसके लिए एकाग्रता और कठिन परिश्रम की जरूरत होती है। इसी चीज को हम अपनी फिल्म में फॉलो कर रहे है। उम्मीद है लोगों को बेहद पसंद आने वाली है। फिल्म में एक्शन, इमोशन, रोमांस सब भरपूर होगा। कहानी के साथ साथ हमारी फिल्म के गाने भी बेहतरीन होने वाले हैं। हमने इसके प्री प्रोडक्शन पर बेहद मेहनत की है और पूरी एनर्जी के साथ फिल्म की शूटिंग भी कर रहे हैं। उम्मीद है जब यह फिल्म सिनेमाघरों में आएगी, तब दर्शक इस फिल्म को खूब पसंद भी करेंगे।\r\n\r\n<img class=\"alignnone size-medium wp-image-349\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-31-at-10.16.10-1-300x200.jpeg\" alt=\"\" width=\"300\" height=\"200\" />\r\n\r\n&nbsp;\r\n\r\nआपको बता दें कि फिल्म \"मांग भरो सजना\" में इस बार राहुल शर्मा और मेघा श्री के साथ-साथ भोजपुरी फिल्मों के महानायक कुणाल सिंह भी मुख्य भूमिका में नजर आएंगे। निर्देशन के साथ-साथ इस फिल्म का लेखन भी राकेश त्रिपाठी ने किया है। जबकि फिल्म \"मांग भरो सजना\" बाबा मोशन पिक्चर कृत और प्रदीप के शर्मा प्रस्तुति में हो रही है। फिल्म की सह निर्माता अनीता शर्मा हैं। फिल्म \"मांग भरो सजना\" में कुणाल सिंह, देव सिंह, विनीत विशाल, रोहित सिंह मटरु, वीणा पांडे,मोना राय और के के गोस्वामी प्रमुख भूमिकाओं में नजर आएंगी। इस फिल्म के पी आर ओ रंजन सिन्हा है। जबकि एग्जीक्यूटिव प्रोड्यूसर गौरव पटेल और म्यूजिक ओम झा का साजन मिश्रा के साथ होगा। वही फिल्म के डीओपी महेश वेंकट है। फाइट मास्टर दिलीप यादव और डांस मास्टर रिक्की गुप्ता है जो अपने इशारे पर फिल्म के कलाकारों को खूब नचाने वाले हैं।', 'डार्लिंग की सफलता के बाद राहुल शर्मा और मेघाश्री स्टारर फिल्म  \"मांग भरो सजना\" की मुहूर्त के साथ शूटिंग शुरू', '', 'publish', 'open', 'open', '', '%e0%a4%a1%e0%a4%be%e0%a4%b0%e0%a5%8d%e0%a4%b2%e0%a4%bf%e0%a4%82%e0%a4%97-%e0%a4%95%e0%a5%80-%e0%a4%b8%e0%a4%ab%e0%a4%b2%e0%a4%a4%e0%a4%be-%e0%a4%95%e0%a5%87-%e0%a4%ac%e0%a4%be%e0%a4%a6-%e0%a4%b0', '', '', '2023-08-31 04:58:21', '2023-08-31 04:58:21', '', 0, 'https://starnewsmedia.in/?p=346', 0, 'post', '', 0),
