(350, 1, '2023-08-31 04:50:50', '2023-08-31 04:50:50', 'बाबा मोशन पिक्चर्स के बैनर से बनने वाली बॉलीवुड अभिनेता राहुल शर्मा और <strong>मेघाश्री</strong> स्टारर फिल्म \"मांग भरो सजना\" की शूटिंग भव्य मुहूर्त के साथ शुरू हो गई है। फिल्म के शूटिंग लखनऊ की खूबसूरत वादियों में हो रही है, जिसमें राहुल शर्मा फिल्म डार्लिंग के बाद एक बार फिर से दमदार भूमिका में नजर आने वाले हैं। इसका अंदाजा फिल्म के पहले दिन के शूट से लगाया जाने लगा है। फिल्म \"मांग भरो सजना\" की पटकथा सामाजिक और पारिवारिक धागों से पिरोई गई है, जो खुद राहुल शर्मा ने बताया। उन्होंने कहा कि फिल्म मेरे लिए बेहद महत्वपूर्ण है और पिछली फिल्म में मिले दर्शकों के प्यार और आशीर्वाद ने मुझे एक बार फिर से भोजपुरी में फिल्म करने को प्रेरित किया है। इस फिल्म में भी मेरी भूमिका बेहद अलग है, जो आपका खूब मनोरंजन करेगी। फिल्म के गीत संगीत भी एक से बढ़कर एक होने वाले हैं। फिल्म मनोरंजन का बेजोड़ पैकेज बन कर उभरेगा। अच्छी कहानी व कथा वाली फिल्म को करना मेरी प्रायरिटी रही है।\r\n\r\n<img class=\"alignnone size-medium wp-image-348\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-31-at-10.16.10-300x200.jpeg\" alt=\"\" width=\"300\" height=\"200\" />\r\n\r\nफिल्म \"मांग भरो सजना\" राकेश त्रिपाठी ने बताया कि फिल्म जितना लोग सोच रहे हैं, उससे ज्यादा अच्छी बने इसके लिए एकाग्रता और कठिन परिश्रम की जरूरत होती है। इसी चीज को हम अपनी फिल्म में फॉलो कर रहे है। उम्मीद है लोगों को बेहद पसंद आने वाली है। फिल्म में एक्शन, इमोशन, रोमांस सब भरपूर होगा। कहानी के साथ साथ हमारी फिल्म के गाने भी बेहतरीन होने वाले हैं। हमने इसके प्री प्रोडक्शन पर बेहद मेहनत की है और पूरी एनर्जी के साथ फिल्म की शूटिंग भी कर रहे हैं। उम्मीद है जब यह फिल्म सिनेमाघरों में आएगी, तब दर्शक इस फिल्म को खूब पसंद भी करेंगे।\r\n\r\n<img class=\"alignnone size-medium wp-image-349\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-31-at-10.16.10-1-300x200.jpeg\" alt=\"\" width=\"300\" height=\"200\" />\r\n\r\n&nbsp;\r\n\r\nआपको बता दें कि फिल्म \"मांग भरो सजना\" में इस बार राहुल शर्मा और मेघा श्री के साथ-साथ भोजपुरी फिल्मों के महानायक कुणाल सिंह भी मुख्य भूमिका में नजर आएंगे। निर्देशन के साथ-साथ इस फिल्म का लेखन भी राकेश त्रिपाठी ने किया है। जबकि फिल्म \"मांग भरो सजना\" बाबा मोशन पिक्चर कृत और प्रदीप के शर्मा प्रस्तुति में हो रही है। फिल्म की सह निर्माता अनीता शर्मा हैं। फिल्म \"मांग भरो सजना\" में कुणाल सिंह, देव सिंह, विनीत विशाल, रोहित सिंह मटरु, वीणा पांडे,मोना राय और के के गोस्वामी प्रमुख भूमिकाओं में नजर आएंगी। इस फिल्म के पी आर ओ रंजन सिन्हा है। जबकि एग्जीक्यूटिव प्रोड्यूसर गौरव पटेल और म्यूजिक ओम झा का साजन मिश्रा के साथ होगा। वही फिल्म के डीओपी महेश वेंकट है। फाइट मास्टर दिलीप यादव और डांस मास्टर रिक्की गुप्ता है जो अपने इशारे पर फिल्म के कलाकारों को खूब नचाने वाले हैं।', 'डार्लिंग की सफलता के बाद राहुल शर्मा और मेघाश्री स्टारर फिल्म  \"मांग भरो सजना\" की मुहूर्त के साथ शूटिंग शुरू', '', 'inherit', 'closed', 'closed', '', '346-revision-v1', '', '', '2023-08-31 04:50:50', '2023-08-31 04:50:50', '', 346, 'https://starnewsmedia.in/?p=350', 0, 'revision', '', 0),
(351, 1, '2023-08-31 04:52:20', '2023-08-31 04:52:20', 'भोजपुरी की खूबसूरत अभिनेत्री अक्षरा सिंह के लिए आज का दिन बेहद खास है। आज जहां <strong>अक्षरा सिंह</strong> का जन्मदिन है, वहीं आज ही <strong>रक्षाबंधन</strong> के अवसर पर उनकी अपकमिंग फिल्म “अक्षरा” का दूसरा लुक भी आउट कर दिया है। फिल्म का सेकेंड लुक और भी बेहतरीन है। इसमें अक्षरा का डबल शेड देखने को मिल रही है। जहां एक ओर वे राजस्थानी से मिलते – जुलते परिधान में हसुआ लेकर नजर आ रही हैं, वहीं दूसरी ओर वे एक पारिवारिक महिला के रूप में भी नजर आ रही हैं। उनका यह रूप भोजपुरी भाषी क्षेत्रों में स्कूल टीचर का होता है। अक्षरा का दोनों शेड बेहद आकर्षक है और फिल्म का लुक उनके खास दिन पर रीविल हुआ है, तो फैंस उन्हें जन्मदिन की बधाई के साथ फिल्म के सक्सेस की भी कामना कर रहे हैं।\r\n\r\nआपको बता दें कि अक्षरा सिंह को आज जन्मदिन पर खूब बढ़ाईयां भी मिल रही हैं, तो उनकी फिल्म के सेकेंड लुक के लिए सराहना भी मिल रही है। फिल्म का फर्स्ट लुक भी खूब वायरल हुआ था और लोगों ने उस वक्त भी उसे खूब प्यार दिया था, जिसमें अक्षरा सिंह बेहद गुस्से में नजर आ रही थीं। गुस्सा भी इतना कि हसुआ उठाने की नौबत थी और तब यह इस तस्वीर को अक्षरा सिंह ने खुद ही अपने इंस्टाग्राम एकाउंट पर शेयर भी किया है। बताते चलें कि अक्षरा सिंह की यह फिल्म भी महिला सशक्तिकरण पर आधारित होने वाली है। फिल्म के टाइटल में अक्षरा सिंह के नाम को ही रखा गया है। फिल्म के निर्माता रत्नाकर कुमार व कुलदीप श्रीवास्तव और निर्देशक देव पांडेय एवं लेखक राकेश त्रिपाठी हैं, जिन्होंने अक्षरा सिंह को जन्मदिन पर बधाई एवं शुभ कामनायें दी। उनके साथ फिल्म की पूरी कास्ट एण्ड क्रू ने अक्षरा की लंबी आयु की कामना की।\r\n\r\nसबों से मिल रही शुभकामनाओं से गदगद अक्षरा सिंह ने फिल्म अक्षरा के मेकर्स, कलाकार और अपने सभी चाहने वाले को शुक्रिया कहा। अक्षरा ने कहा कि जन्मदिन पर लोगों का बहुत सारा प्यार मिल रहा है और मेरी फिल्म के पोस्टर भी सबों को पसंद आ रही है। इससे बड़ा दिन मेरे लिए और क्या हो सकता है। बस जन्मदिन पर एक विश अपने फैंस से पूरी करने की उम्मीद रखती हूँ कि जब भी मेरी यह फिल्म रिलीज हो। आप जरूर देखें।\r\n\r\nबताते चलें कि वर्ल्डवाइड चैनल और सबरंग फिल्म प्रोडक्शंस प्रस्तुत फिल्म “अक्षरा” में अक्षरा सिंह के साथ अंशुमान मिश्रा, धानी गुप्ता, विनोद मिश्रा, अनुप अरोरा, विनीत विशाल, जे.नीलम, मटरू, बीना पांडे, शुभकिशन शुक्ला, प्रतिभा साहू, ललित उपाध्याय, विद्या सिंह, सीपी भट्ट, संजीव मिश्रा, अखिलेश शुक्ला, संजू सोलंकी, रिंकी शुक्ला, आर.नरेंद्र, आर्यन विश्वकर्मा, कानू मुखर्जी, सोनू सनम माही, कन्हिया एस.विश्वकर्मा, सौरव चौधरी, सनाया गुप्ता, रितिका सिंह, पप्पू खान, एचआरपी बाबू, चंचल त्रिपाठी और सतीश यादव प्रमुख भूमिका में हैं। फिल्म के संगीतकार ओम झा और गीतकार प्यारे लाल यादव \'कवि जी\', सभा वर्मा, फनिदर राव व राकेश निराला हैं। पीआरओ रंजन सिन्हा हैं। छायाकार जगविंदर सिंह हुंदल (जग्गी पाजी), क्रिएटिव डायरेक्टर कन्हैया एस.विश्वकर्मा और वीएफएक्स फरहान जादा हैं। कला राम बाबू ठाकुर, कोरियोग्राफर कानू मुखर्जी और एक्शन प्रदीप खड़का का है।', 'रक्षाबंधन और अक्षरा सिंह के जन्मदिन पर रीविल हुआ फिल्म “अक्षरा” का सेकेंड लुक', '', 'publish', 'open', 'open', '', '%e0%a4%b0%e0%a4%95%e0%a5%8d%e0%a4%b7%e0%a4%be%e0%a4%ac%e0%a4%82%e0%a4%a7%e0%a4%a8-%e0%a4%94%e0%a4%b0-%e0%a4%85%e0%a4%95%e0%a5%8d%e0%a4%b7%e0%a4%b0%e0%a4%be-%e0%a4%b8%e0%a4%bf%e0%a4%82%e0%a4%b9', '', '', '2023-08-31 04:52:20', '2023-08-31 04:52:20', '', 0, 'https://starnewsmedia.in/?p=351', 0, 'post', '', 0),
