(353, 1, '2023-08-31 04:52:20', '2023-08-31 04:52:20', 'भोजपुरी की खूबसूरत अभिनेत्री अक्षरा सिंह के लिए आज का दिन बेहद खास है। आज जहां <strong>अक्षरा सिंह</strong> का जन्मदिन है, वहीं आज ही <strong>रक्षाबंधन</strong> के अवसर पर उनकी अपकमिंग फिल्म “अक्षरा” का दूसरा लुक भी आउट कर दिया है। फिल्म का सेकेंड लुक और भी बेहतरीन है। इसमें अक्षरा का डबल शेड देखने को मिल रही है। जहां एक ओर वे राजस्थानी से मिलते – जुलते परिधान में हसुआ लेकर नजर आ रही हैं, वहीं दूसरी ओर वे एक पारिवारिक महिला के रूप में भी नजर आ रही हैं। उनका यह रूप भोजपुरी भाषी क्षेत्रों में स्कूल टीचर का होता है। अक्षरा का दोनों शेड बेहद आकर्षक है और फिल्म का लुक उनके खास दिन पर रीविल हुआ है, तो फैंस उन्हें जन्मदिन की बधाई के साथ फिल्म के सक्सेस की भी कामना कर रहे हैं।\r\n\r\nआपको बता दें कि अक्षरा सिंह को आज जन्मदिन पर खूब बढ़ाईयां भी मिल रही हैं, तो उनकी फिल्म के सेकेंड लुक के लिए सराहना भी मिल रही है। फिल्म का फर्स्ट लुक भी खूब वायरल हुआ था और लोगों ने उस वक्त भी उसे खूब प्यार दिया था, जिसमें अक्षरा सिंह बेहद गुस्से में नजर आ रही थीं। गुस्सा भी इतना कि हसुआ उठाने की नौबत थी और तब यह इस तस्वीर को अक्षरा सिंह ने खुद ही अपने इंस्टाग्राम एकाउंट पर शेयर भी किया है। बताते चलें कि अक्षरा सिंह की यह फिल्म भी महिला सशक्तिकरण पर आधारित होने वाली है। फिल्म के टाइटल में अक्षरा सिंह के नाम को ही रखा गया है। फिल्म के निर्माता रत्नाकर कुमार व कुलदीप श्रीवास्तव और निर्देशक देव पांडेय एवं लेखक राकेश त्रिपाठी हैं, जिन्होंने अक्षरा सिंह को जन्मदिन पर बधाई एवं शुभ कामनायें दी। उनके साथ फिल्म की पूरी कास्ट एण्ड क्रू ने अक्षरा की लंबी आयु की कामना की।\r\n\r\nसबों से मिल रही शुभकामनाओं से गदगद अक्षरा सिंह ने फिल्म अक्षरा के मेकर्स, कलाकार और अपने सभी चाहने वाले को शुक्रिया कहा। अक्षरा ने कहा कि जन्मदिन पर लोगों का बहुत सारा प्यार मिल रहा है और मेरी फिल्म के पोस्टर भी सबों को पसंद आ रही है। इससे बड़ा दिन मेरे लिए और क्या हो सकता है। बस जन्मदिन पर एक विश अपने फैंस से पूरी करने की उम्मीद रखती हूँ कि जब भी मेरी यह फिल्म रिलीज हो। आप जरूर देखें।\r\n\r\nबताते चलें कि वर्ल्डवाइड चैनल और सबरंग फिल्म प्रोडक्शंस प्रस्तुत फिल्म “अक्षरा” में अक्षरा सिंह के साथ अंशुमान मिश्रा, धानी गुप्ता, विनोद मिश्रा, अनुप अरोरा, विनीत विशाल, जे.नीलम, मटरू, बीना पांडे, शुभकिशन शुक्ला, प्रतिभा साहू, ललित उपाध्याय, विद्या सिंह, सीपी भट्ट, संजीव मिश्रा, अखिलेश शुक्ला, संजू सोलंकी, रिंकी शुक्ला, आर.नरेंद्र, आर्यन विश्वकर्मा, कानू मुखर्जी, सोनू सनम माही, कन्हिया एस.विश्वकर्मा, सौरव चौधरी, सनाया गुप्ता, रितिका सिंह, पप्पू खान, एचआरपी बाबू, चंचल त्रिपाठी और सतीश यादव प्रमुख भूमिका में हैं। फिल्म के संगीतकार ओम झा और गीतकार प्यारे लाल यादव \'कवि जी\', सभा वर्मा, फनिदर राव व राकेश निराला हैं। पीआरओ रंजन सिन्हा हैं। छायाकार जगविंदर सिंह हुंदल (जग्गी पाजी), क्रिएटिव डायरेक्टर कन्हैया एस.विश्वकर्मा और वीएफएक्स फरहान जादा हैं। कला राम बाबू ठाकुर, कोरियोग्राफर कानू मुखर्जी और एक्शन प्रदीप खड़का का है।', 'रक्षाबंधन और अक्षरा सिंह के जन्मदिन पर रीविल हुआ फिल्म “अक्षरा” का सेकेंड लुक', '', 'inherit', 'closed', 'closed', '', '351-revision-v1', '', '', '2023-08-31 04:52:20', '2023-08-31 04:52:20', '', 351, 'https://starnewsmedia.in/?p=353', 0, 'revision', '', 0),
(354, 1, '2023-08-31 04:55:24', '2023-08-31 04:55:24', 'नमस्कार दोस्तों 🙏\r\nजैसा कि आप सभी को पता है पवन सिंह पिछले एक महीना से अपने आगामी फिल्म बजरंगी की शूटिंग में व्यस्त थे जिसकी शूटिंग लंदन यूनाइटेड किंगडम में किया जा रहा था बजरंगी फिल्म की शूटिंग यूनाइटेड किंगडम में फर्स्ट शेड्यूल की शूटिंग कंप्लीट कर दी गई है\r\nशूटिंग कंप्लीट करते हैं आज पवन सिंह ने लंदन से इंडिया के धरती पर फिर से वापस आ चुके हैं दोस्तों में बता दूं कि फिल्म के प्रोड्यूसर हैं :------ अभय सिंह सर और डायरेक्टर है :---- रजनीश मिश्रा जी एसोसिएट डायरेक्टर :-- सुउवेश सिंह\r\nस्टार कास्ट की बात करें तो में लीड में है आपके भोजपुरी के महानायक पावर स्टार पवन सिंह जी और उनके अपोजिट लेट में है हर्षिता पॉर्नवर, हर्षिता कश्यप, टीनू वर्मा, अमित शुक्ला Ep :- सोनू शेख, प्रोजेक्ट हेड :---- पंकज तिवारी,\r\nक्रिएटिव डायरेक्टर कुमार देव, सिंह ज्योति, अनिल मल्होत्रा सर\r\nPC:- कुबेर बेहरा, ड्रेस:---- सत्येंद्र कनौजिया\r\nबजरंगी फिल्म एक बहुत बड़ी फिल्म है क्योंकि आप सभी को बहुत पसंद आने वाला है\r\nभोजपुरी की बॉलीवुड की लगातार ऐसी खबरें से अपडेट होने के लिए हमारे स्टार न्यूज़ वेबसाइट पर आप सभी जुड़ जाए\r\nधन्यवाद 🙏', 'आज पवन सिंह ने लंदन से इंडिया के धरती पर फिर से वापस आ चुके हैं', '', 'publish', 'open', 'open', '', '%e0%a4%86%e0%a4%9c-%e0%a4%aa%e0%a4%b5%e0%a4%a8-%e0%a4%b8%e0%a4%bf%e0%a4%82%e0%a4%b9-%e0%a4%a8%e0%a5%87-%e0%a4%b2%e0%a4%82%e0%a4%a6%e0%a4%a8-%e0%a4%b8%e0%a5%87-%e0%a4%87%e0%a4%82%e0%a4%a1%e0%a4%bf', '', '', '2023-08-31 04:56:31', '2023-08-31 04:56:31', '', 0, 'https://starnewsmedia.in/?p=354', 0, 'post', '', 0),
