(358, 1, '2023-12-24 07:23:24', '2023-12-24 07:23:24', 'भोजपुरी की इकलौती खूबसूरत अदाकारा Anjana Singh को मिला Best Popular Actress का Award\r\nबोली ए मेरी मेहनत और लगन से काम करने का फल प्राप्त कर के दिल बहुत प्रसन्न है\r\nइस अवार्ड का हकदार हमसे ज्यादा हमारी दर्शक है तो आप सभी को स ह्रदय से धन्यवाद.\r\n\r\n<img class=\"alignnone size-medium wp-image-359\" src=\"https://starnewsmedia.in/wp-content/uploads/2023/12/IMG-20231224-WA0006-240x300.jpg\" alt=\"\" width=\"240\" height=\"300\" />\r\n\r\n<a href=\"https://youtu.be/-P2JM0OHFkg\" target=\"_blank\" rel=\"noopener\">https://youtu.be/-P2JM0OHFkg?si=eCxSQl7ueIGfwI12</a>\r\n\r\n🙏Love You All ❤🙏', 'अंजना सिंह को मिला भोजपुरी में सबसे बड़ा अवार्ड', '', 'publish', 'open', 'open', '', '%e0%a4%85%e0%a4%82%e0%a4%9c%e0%a4%a8%e0%a4%be-%e0%a4%b8%e0%a4%bf%e0%a4%82%e0%a4%b9-%e0%a4%95%e0%a5%8b-%e0%a4%ae%e0%a4%bf%e0%a4%b2%e0%a4%be-%e0%a4%ad%e0%a5%8b%e0%a4%9c%e0%a4%aa%e0%a5%81%e0%a4%b0', '', '', '2023-12-30 05:44:19', '2023-12-30 05:44:19', '', 0, 'https://starnewsmedia.in/?p=358', 0, 'post', '', 0),
